  {
   int j,k;
   double somatorio,somatorio1;
   double soma;
   soma=0;
   for(k=0;k<NSAI;k++)
    {
     soma=soma+op[k];
    }
    for(j=1;j<NINT;j++)
     {
      somatorio = 0.0;
      somatorio1= 0.0;
      for(k=0;k<NSAI;k++)
      {
       somatorio=somatorio   + delta2[k] * w2[j][k];
       somatorio1=somatorio1 + delta2[k] * w2[j][k]*soma;
      }
      delta1[j]= h[j] * (1 - h[j]) * somatorio;
      delta3[j]= h[j] * (1 - h[j]) * somatorio1;
     }
  }

